    "dev": "nuxt",
    "gen": "nuxt generate"
  },
  "dependencies": {
    "@nuxtjs/google-analytics": "^2.2.0",
    "highlight.js": "^9.15.6",
    "nuxt": "^2.6.1",
    "v-clipboard": "^2.2.2",
    "vue-highlightjs": "^1.3.3"
  },
  "devDependencies": {
    "node-sass": "^4.11.0",
    "raw-loader": "^2.0.0",
